+// Package github provides a GitHub MCP server implementation for GitHub API operations.
+package github
+
+import (
+	"context"
+	"fmt"
+	"net/http"
+	"strconv"
+	"strings"
+	"time"
+
+	"github.com/google/go-github/v55/github"
+
+	"github.com/ondatra-ai/flow-test-go/pkg/errors"
+	"github.com/ondatra-ai/flow-test-go/pkg/types"
+)
+
+// Provider implements the GitHub MCP server provider.
+type Provider struct {
+	client *github.Client
+	token  string
+}
+
+// Config holds the configuration for the GitHub provider.
+type Config struct {
+	Token string `json:"token"`
+}
+
+// tokenTransport implements http.RoundTripper to add GitHub token authentication.
+type tokenTransport struct {
+	Token string
+	Base  http.RoundTripper
+}
+
+// RoundTrip implements http.RoundTripper interface to add Authorization header.
+func (t tokenTransport) RoundTrip(req *http.Request) (*http.Response, error) {
+	cloned := req.Clone(req.Context())
+	cloned.Header.Set("Authorization", "token "+t.Token)
+
+	response, err := t.base().RoundTrip(cloned)
+	if err != nil {
+		return nil, fmt.Errorf("GitHub API request failed: %w", err)
+	}
+
+	return response, nil
+}
+
+// base returns the base transport, defaulting to http.DefaultTransport.
+func (t tokenTransport) base() http.RoundTripper {
+	if t.Base != nil {
+		return t.Base
+	}
+
+	return http.DefaultTransport
+}
+
+// New creates a new GitHub provider with the given token.
+func New(token string) (*Provider, error) {
+	if token == "" {
+		return nil, &types.ExecutionError{
+			Code:        "GITHUB_TOKEN_REQUIRED",
+			Message:     "GitHub token is required",
+			Details:     nil,
+			Recoverable: false,
+			Timestamp:   time.Now(),
+			StackTrace:  "",
+		}
+	}
+
+	// Create HTTP client with token authentication
+	httpClient := &http.Client{
+		Transport:     tokenTransport{Token: token, Base: nil},
+		CheckRedirect: nil,
+		Jar:           nil,
+		Timeout:       0,
+	}
+
+	// Create GitHub client and enforce api.github.com only
+	client := github.NewClient(httpClient)
+
+	// Verify the base URL is github.com
+	if client.BaseURL.Host != "api.github.com" {
+		return nil, &types.ExecutionError{
+			Code:        "GITHUB_DOMAIN_NOT_ALLOWED",
+			Message:     "only api.github.com is allowed, got: " + client.BaseURL.Host,
+			Details:     map[string]any{"host": client.BaseURL.Host},
+			Recoverable: false,
+			Timestamp:   time.Now(),
+			StackTrace:  "",
+		}
+	}
+
+	return &Provider{
+		client: client,
+		token:  token,
+	}, nil
+}
+
+// NewFromConfig creates a new GitHub provider from configuration.
+func NewFromConfig(config map[string]any) (types.ToolProvider, error) {
+	token, tokenExists := config["token"].(string)
+	if !tokenExists {
+		return nil, &types.ExecutionError{
+			Code:        "GITHUB_TOKEN_REQUIRED",
+			Message:     "github server requires 'token' string configuration",
+			Details:     map[string]any{"config": config},
+			Recoverable: false,
+			Timestamp:   time.Now(),
+			StackTrace:  "",
+		}
+	}
+
+	return New(token)
+}
+
+// GetTools returns metadata for all tools provided by this server.
+func (p *Provider) GetTools() []types.ToolMetadata {
+	return []types.ToolMetadata{
+		{
+			Name:        "github_get_issue",
+			Description: "Retrieve GitHub issue data including title, body, state, and labels",
+			Parameters: map[string]string{
+				"owner":        "string",
+				"repo":         "string",
+				"issue_number": "number",
+			},
+			Returns: map[string]string{
+				"title":  "string",
+				"body":   "string",
+				"state":  "string",
+				"labels": "string[]",
+			},
+			ContextIO: types.ContextIO{
+				Reads:  []string{},
+				Writes: []string{"github_issue", "last_error"},
+			},
+		},
+	}
+}
+
+// ExecuteTool executes the specified tool with the given arguments.
+func (p *Provider) ExecuteTool(ctx context.Context, call types.ToolCall) types.ToolResult {
+	switch call.Name {
+	case "github_get_issue":
+		return p.executeGetIssue(ctx, call)
+	default:
+		return types.ToolResult{
+			Success:       false,
+			Result:        nil,
+			Error:         "unknown tool: " + call.Name,
+			ContextWrites: nil,
+		}
+	}
+}
+
+// GetServerName returns the name of this MCP server.
+func (p *Provider) GetServerName() string {
+	return "github"
+}
+
+// executeGetIssue implements the github_get_issue tool logic.
+func (p *Provider) executeGetIssue(ctx context.Context, call types.ToolCall) types.ToolResult {
+	// Validate parameters
+	ownerParam, repoParam, issueNum, validationErr := p.validateGetIssueParams(call.Arguments)
+	if validationErr != nil {
+		return *validationErr
+	}
+
+	// Call GitHub API
+	issue, response, err := p.client.Issues.Get(ctx, ownerParam, repoParam, issueNum)
+	if err != nil {
+		return p.handleAPIError(err, response)
+	}
+
+	return p.buildGetIssueResult(issue)
+}
+
+// validateGetIssueParams validates the parameters for github_get_issue tool.
+func (p *Provider) validateGetIssueParams(arguments map[string]any) (string, string, int, *types.ToolResult) {
+	ownerParam, ownerExists := arguments["owner"].(string)
+	if !ownerExists || ownerParam == "" {
+		return "", "", 0, &types.ToolResult{
+			Success:       false,
+			Result:        nil,
+			Error:         "owner parameter must be a non-empty string",
+			ContextWrites: nil,
+		}
+	}
+
+	repoParam, repoExists := arguments["repo"].(string)
+	if !repoExists || repoParam == "" {
+		return "", "", 0, &types.ToolResult{
+			Success:       false,
+			Result:        nil,
+			Error:         "repo parameter must be a non-empty string",
+			ContextWrites: nil,
+		}
+	}
+
+	issueNum, err := p.parseIssueNumber(arguments["issue_number"])
+	if err != nil {
+		return "", "", 0, &types.ToolResult{
+			Success:       false,
+			Result:        nil,
+			Error:         err.Error(),
+			ContextWrites: nil,
+		}
+	}
+
+	return ownerParam, repoParam, issueNum, nil
+}
+
+// parseIssueNumber parses the issue_number parameter from various types.
+func (p *Provider) parseIssueNumber(issueNumberParam any) (int, error) {
+	var issueNumber int
+	switch paramValue := issueNumberParam.(type) {
+	case float64:
+		issueNumber = int(paramValue)
+	case int:
+		issueNumber = paramValue
+	case string:
+		var parseErr error
+
+		issueNumber, parseErr = strconv.Atoi(paramValue)
+		if parseErr != nil {
+			return 0, fmt.Errorf("issue_number parameter must be a number: %w", parseErr)
+		}
+	default:
+		return 0, fmt.Errorf("got %T: %w", issueNumberParam, errors.ErrInvalidParameterType)
+	}
+
+	if issueNumber <= 0 {
+		return 0, fmt.Errorf("got %d: %w", issueNumber, errors.ErrInvalidIssueNumber)
+	}
+
+	return issueNumber, nil
+}
